import '../res/style/App.css';

const About = () => {
    return (
        <div className="Body">
            <h1>About</h1>
            <p>I started developing software at 10 years old, and haven't stopped since! You can still check out my first project, a website, on my portfolio. </p>
            <p>I graduated from UC, Santa Barbara with a degree in Computer Engineering in 2022. I had the chance to work with some great folks at Aptitude Medical Systems while completing the UCSB Capstone project.</p>
        </div>
    );
}

export default About;
